import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import { Box, Button, Container, TextField, Typography } from "@mui/material";
import { signUpFetch } from "../ReduxPages/ReduxSlices/signup-slice";

export default function SignUp() {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();
  const dispatch = useDispatch();
  

  async function clickHandler(e) {
    e.preventDefault();
    await dispatch(signUpFetch({ username, email, password }));
    // navigate("/");
  }

  return (
    <Container
      component={"div"}
      sx={{
        pt: "50px",
        pb: "50px",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        flexDirection: "column",
      }}
    >
      <Typography component={"h2"} sx={{ color: "#5CB85C", fontSize: "30px" }}>
        Sign Up
      </Typography>
      <Link to="/signin" className="haveAnAccount" style={{ color: "#5CB85C" }}>
        {" "}
        Have An Account{" "}
      </Link>
      <Box
        component={"form"}
        onSubmit={clickHandler}
        sx={{
          width: "70%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexDirection: "column",
        }}
      >
        <TextField
          id="username"
          label="Username"
          variant="outlined"
          sx={{ mt: "30px", mb: "30px", width: "70%" }}
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
        <TextField
          id="email"
          label="Email"
          variant="outlined"
          sx={{ mb: "30px", width: "70%" }}
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <TextField
          id="password"
          label="Password"
          variant="outlined"
          type=""
          sx={{ mb: "30px", width: "70%" }}
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <Button
          type="submit"
          className="btn"
          sx={{
            color: "#5CB85C",
            borderColor:"#5CB85C",
            borderWidth:"1px", 
            borderStyle:"solid",
            "&:hover": { color: "white", backgroundColor: "#5CB85C" },
          }}
        >
          Register
        </Button>
      </Box>
    </Container>
  );
}
